import Link from "next/link";
import Navbar from '../components/navbar'

const About = () => (
  <div>
    <Navbar></Navbar>
    <h1>This page about the creator</h1>
    <h3>This site was made with Next js</h3>
    <h3>And this site is about bitcoin pricing</h3>
  </div>
);
export default About;
